            </div>

            <div className="MenuContainer">

                <div className="MenutBtn">
                    <div className="LogoMenu">test</div>
                    <div className="NamaMenu">Jadwal</div>
                </div>

                <div className="MenutBtn">
                    <div className="LogoMenu">test</div>
                    <div className="NamaMenu">Jadwal</div>
                </div>

                <div className="MenutBtn">
                    <div className="LogoMenu">test</div>
                    <div className="NamaMenu">Jadwal</div>
                </div>
            </div>

            <div className="footer">
                <div className="Profile"></div>
                <div className="Nama">Budi</div>
            </div>

        </div>


    );


};


const IsiContainer = () => {

    return(

        <div className="sdsdcf">
        <div className="sasdc">INI HOME</div>

    </div>


    );




};



const HomeContainer = () => {

    return(
       <div className="test">
        <MenuContainer />
        <IsiContainer />
        </div>


    );



};

export default HomeContainer;
